import React from 'react';

import logo from '../images/logo_icon.gif';

function Navbar() {
  return (
    <ul className='d-flex flex-row align-items-center justify-content-around container m-1'>
      <li><img style={{maxWidth:'18vw'}}src={logo}></img></li>
      <li><a href='#'>Motion Graphics</a></li>
      <li><a href='#'>Graphic Design</a></li>
    </ul>
  )
}


export default Navbar;
